script: |
  super -f text -I q463.spq | sort > q463.out

inputs:
  - name: q463.spq
    data: |
      SELECT ALL - col2 * + col0 + + 45 * - - col2 + col1 AS col1 FROM tab0 (FORMAT parquet) WHERE - 32 * - col2 * - col0 NOT IN ( ( - col1 ), - 29, + + col0 + + + col2 );
  - name: tab0

outputs:
  - name: q463.out
    data: |
      -399
      -5147
      1491
